import logo from './logo.svg';
import './App.css';
import Hello from "./component/profilePage/Hello"
import ProfilePage from './component/profilePage/ProfilePage';
import './assets/css/profilePage.css'

function App() {
  return (
    <div className="App">
      <Hello/>
      <ProfilePage/>
      <marquee scrollamount="20" className="scroll-name"> fahima farook</marquee>
    </div>
  );
}

export default App;
